{
    "schema": {
        "properties": {
            "id": {
                "description": "The unique id of the user",
                "title": "Id",
                "type": "int"
            },
            "username": {
                "description": "The username of the user",
                "title": "Username",
                "type": "user_name"
            },
            "email": {
                "description": "The email of the user",
                "title": "Email",
                "type": "ascii_company_email"
            },
            "created_at": {
                "description": "The date and time the user was created",
                "format": "date-time",
                "title": "Created At",
                "type": "unix_time"
            },
            "updated_at": {
                "description": "The date and time the user was last updated",
                "format": "date-time",
                "title": "Updated At",
                "type": "unix_time"
            }
        },
        "required": [
            "id",
            "username",
            "email",
            "created_at",
            "updated_at"
        ],
        "title": "User",
        "type": "object"
    }
}
